import React from 'react'

function FrontPage() {
    return (
      <div className="frontPage">
          <img className="logo" src="images/largeLogo.png" alt="Eat-In"/>
        <br/>
        <div className="frontPageButtons">
          <button className="button1">Log-In</button><br/>  
          <button className="button2">Get-In</button>
        </div>
      </div>
    );
  }

export default FrontPage;
